import React, {useState} from 'react';
import { SwipeableList, SwipeableListItem } from '@sandstreamdev/react-swipeable-list';
import '@sandstreamdev/react-swipeable-list/dist/styles.css';
import GroceryItem from './GroceryItem';
import {makeStyles} from '@material-ui/styles';
import Palette from '../../utils/palette';

const useStyles = makeStyles({
  root: {
    paddingBottom: '10vh',
    '&>div': {
      background: Palette.Red,
    }
  }
})

const GroceryList = () => {
  const classes = useStyles();
  const [groceries, setGroceries] = useState(groceryArr);
  const deleteGroceryById = (id) => setGroceries(groceries.filter(grocery => grocery._id != id));

  return (
    <div className={classes.root}>
      <div>
        {groceries.map(grocery => <GroceryItem deleteGroceryById={deleteGroceryById} grocery={grocery}/>)}
      </div>
    </div>
  )
}

export default GroceryList;

